INSERT INTO data (id,url,title,description,keywords) VALUES (8293079,'http://www.nd.gov', 'None', 'Welcome to North Dakota where possibility is as endless as the horizon. Whether you crave the rugged outdoors or thrive in urban settings, you’ll find vibrant, diverse communities and the shortest average commute time in the country. This rising travel trend – embracing the winter cold and spending more time outdoors in spite of it – is called “friluftsliv.” This translates to “free air life,” a Norwegian concept that being outdoors in all types of weather is good for the mind and body. It’s about connecting with nature, no matter the weather. And, as they say in North Dakota – a U.S. hotspot for Norwegian/Scandinavian culture – if you think it’s too cold, you’re just not dressed warmly enough. North Dakota has numerous outdoor attractions and rich Scandinavian heritage that allow travelers from near and far to embrace friluftsliv and reconnect with nature safely in its wide open spaces where you won’t find crowds (except for crowds of bison, of course).', ARRAY['stateofnorthdakota']);
